const InjuryList = ({ injurys, title }) => {
  // const injurys = props.injurys;
  // const title = props.title;
  // console.log(injurys);

  return (
    <div className="injury-list">
      <h2>{title}</h2>
      {injurys.map((injury) => (
        <div className="injury-preview" key={injury.id}>
          <h2>{injury.title}</h2>
          <p>Written by {injury.author}</p>
        </div>
      ))}
    </div>
  );
};

export default InjuryList;
